// src/components/ProfessorDashboard/TurmasList.js
import React from 'react';
import { Typography, Box, List, ListItem, ListItemText, Button } from '@mui/material';

const TurmasList = () => {
  // Mock de dados de turmas
  const turmas = [
    { id: 1, nome: 'Turma A' },
    { id: 2, nome: 'Turma B' },
    { id: 3, nome: 'Turma C' },
  ];

  const handleEdit = (id) => {
    // L贸gica para editar turma
    console.log('Editar Turma com ID:', id);
  };

  const handleDelete = (id) => {
    // L贸gica para excluir turma
    console.log('Excluir Turma com ID:', id);
  };

  return (
    <Box sx={{ padding: 2 }}>
      <Typography variant="h4" gutterBottom>
        Lista de Turmas
      </Typography>
      <List>
        {turmas.map((turma) => (
          <ListItem key={turma.id} secondaryAction={
            <>
              <Button onClick={() => handleEdit(turma.id)}>Editar</Button>
              <Button onClick={() => handleDelete(turma.id)}>Excluir</Button>
            </>
          }>
            <ListItemText primary={turma.nome} />
          </ListItem>
        ))}
      </List>
    </Box>
  );
};

export default TurmasList;
